import React from 'react'
import Book from './components/Book'
import './App.css'

let books = [
  {
    id: 1,
    title: "ikigai",
    author: "hector",
    price: 150
  },
  {
    id: 1,
    title: "ikigai",
    author: "hector",
    price: 150
  },
]

const App = () => {
  return (
    <div id='main-container'>
      {
        books.map(
          (element) => {
            return <Book id={element.id} title={element.title} author={element.author} price={element.price}></Book>
          }
        )
      }
    </div>
  )
}

export default App
